import React from 'react';
import './App.css'


function App() {
  return (
    <div height={20} width={20} my={4} display="flex" alignItems="center" gap={4}>
      <div className='slider'
        aria-label="Temperature"
        defaultValue={30}
        valueLabelDisplay="auto"
        step={10}
        marks
        min={10}
        max={110}
      />
      <div className='slider-handle' defaultValue={30} step={10} marks min={10} max={110} disabled />
    </div>
  );
}
export default App;
